import React, { useState, useEffect } from "react";
import axios from "axios";
function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get("/fakeData").then((data) => {
            setData(data);
            console.log(data);
        });
    }, []);

    return (
        <div className="App">
            {data.data.map((d, i) => {
                <p key={i}>{d}</p>;
            })}
        </div>
    );
}

export default App;
